import React, { Component } from 'react';
//import logo from '../logo.svg';
import logo from './logo2.png'
import { Route } from 'react-router-dom';
import * as Pages from "./pages/index";
import './css/App.css';

class App extends Component {
  render() {
    return (
      <div>
        <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.7.2/css/all.css" integrity="sha384-fnmOCqbTlWIlj8LyTjo7mOUStjsKC4pOpQbqyi7RrhN7udi9RwhKkMHpvLbHG9Sr" crossorigin="anonymous"/>

        <Route path="/" exact component={Pages.About}/>
        <Route path="/projects" component={Pages.Projects}/>
        <Route path="/resume" component={Pages.Resume}/>
        <Route path="/chatboard" component={Pages.ChatBoard}/>
        <Route path="/cecomputerrepairs" component={Pages.CE}/>
        <Route path="/thecellphonelab" component={Pages.TCPL}/>
        <Route path="/zuna" component={Pages.Zuna}/>
        <Route path="/freezachess" component={Pages.FreezaChess}/>
    </div>
    );
  }
}

export default App;
